import { GET_ARTICLES } from '../constants'

const initialState = {
    articles: []
}

const GetArticleData = (state=initialState, action) => {
    switch(action.type) {
        case GET_ARTICLES:
            return {...state, articles: action.payload}
        default:
            return state;
    }
}

export default GetArticleData
